import React from 'react';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import { useNavigate } from 'react-router-dom';

function About() {
    const navigate = useNavigate();

    return (
        <>
            <AppBar position="static">
                    <Toolbar>
                        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                            Anaemia Predictor
                        </Typography>
                        <Button
                            variant="contained"
                            color="secondary"
                            onClick={() => navigate("/signup")}
                            sx={{
                                background: "linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
                                boxShadow: "0px 3px 5px 2px rgba(255, 105, 135, .3)",
                                color: "white",
                                "&:hover": {
                                    background: "linear-gradient(45deg, #FF8E53 30%, #FE6B8B 90%)",
                                    boxShadow: "0px 5px 10px 2px rgba(255, 105, 135, .3)",
                                },
                                mr: 1,
                            }}
                        >
                            Sign Up
                        </Button>
                        <Button
                            variant="contained"
                            color="secondary"
                            onClick={() => navigate("/signin")}
                            sx={{
                                background: "linear-gradient(45deg, #3F51B5 30%, #2196F3 90%)",
                                boxShadow: "0px 3px 5px 2px rgba(63, 81, 181, .3)",
                                color: "white",
                                "&:hover": {
                                    background: "linear-gradient(45deg, #2196F3 30%, #3F51B5 90%)",
                                    boxShadow: "0px 5px 10px 2px rgba(63, 81, 181, .3)",
                                },
                                ml: 1,
                            }}
                        >
                            Sign In
                        </Button>
                        <Button
                            variant="contained"
                            color="secondary"
                            onClick={() => navigate("/about")}
                            sx={{
                                background: "linear-gradient(45deg, #009688 30%, #004D40 90%)",
                                boxShadow: "0px 3px 5px 2px rgba(0, 150, 136, .3)",
                                color: "white",
                                "&:hover": {
                                    background: "linear-gradient(45deg, #004D40 30%, #009688 90%)",
                                    boxShadow: "0px 5px 10px 2px rgba(0, 150, 136, .3)",
                                },
                                ml: 1,
                            }}
                        >
                            About
                        </Button>
                    </Toolbar>
            </AppBar>
            <Container maxWidth="md">
                <Box sx={{ marginTop: 8, textAlign: 'center' }}>
                    <Typography variant="h4" gutterBottom>
                        About
                    </Typography>
                    <Typography variant="h6" gutterBottom>
                        Developed by NanoBios Lab
                    </Typography>
                    <Typography variant="body1" paragraph>
                        NanoBios Lab can be termed as the perfect breather for a passionate researcher. A learning hub where creative ideas are translated into successful simulations with a positive impact. Every candidate is trained resourcefully to lead research projects and contribute towards smooth operational activities of the lab. The lab group members associate with each other as family and believe in achieving success as a unit combining their expertise coming from various disciplines. Our guide (Prof. Srivastava) has always motivated us to explore solutions for the under-researched challenges majorly impacting our country. This is the place where we are empowered to be skilled independent researchers in future, develop solutions for the healthcare industry and contribute to the maximum towards bringing up a healthier India.
                    </Typography>
                    <Button
                        variant="contained"
                        color="secondary"
                        onClick={() => navigate("/")}
                        sx={{
                            background: "linear-gradient(45deg, #3F51B5 30%, #2196F3 90%)",
                            boxShadow: "0px 3px 5px 2px rgba(63, 81, 181, .3)",
                            color: "white",
                            "&:hover": {
                                background: "linear-gradient(45deg, #2196F3 30%, #3F51B5 90%)",
                                boxShadow: "0px 5px 10px 2px rgba(63, 81, 181, .3)",
                            },
                            mt: 3,
                            mb: 2,
                        }}
                    >
                        Home
                    </Button>
                </Box>
            </Container>
        </>
    );
}

export default About;
